The Football League Show 21.12.2013 

Duration: 1 hour 20 min

Football League highlights presented by Manish Bhasin. Two so-called sleeping giants, Birmingham City and Nottingham Forest, go head to head at St Andrew's, while there are extended highlights from the top-of-the-table clash at Loftus Road where QPR entertain Leicester City.
